import React, { useEffect } from "react";
// import projects from "../Components/Data/projects.json";
// import { useSelector } from "react-redux";
import { useDispatch, useSelector } from "react-redux";
import { setPortfolioData } from "../redux/rootSlice";

const Projects = () => {
  const { portfolioData } = useSelector((state) => state.root);
  const projects = portfolioData ? portfolioData.projects : [];
  const dispatch = useDispatch();

  useEffect(() => {
    const fetchPortfolioData = async () => {
      try {
        const response = await fetch(
          "http://127.0.0.1:8080/api/portfolio/get-portfolio-data"
        );
        const details = await response.json();
        console.log("Fetched Portfolio Data for projects:", details);
        dispatch(setPortfolioData(details.data));
      } catch (error) {
        console.error("Error fetching portfolio data:", error);
      }
    };
    fetchPortfolioData();
  }, [dispatch]);

  useEffect(() => {
    console.log("Portfolio Data from Redux:", portfolioData);
    console.log("Projects:", projects);
  }, [portfolioData, projects]);
  return (
    <>
      <div className="container projects my-4">
        <h1>PROJECTS</h1>
        <div className="row d-flex justify-content-center align-content-center">
          {projects.map((data) => (
            <>
              <div
                key={data.id}
                className="my-4 col-sm-6 col-md-4 col-lg-3 mx-4"
              >
                <div
                  className="card text-light"
                  style={{
                    width: "18rem",
                    border: "1px solid yellowgreen",
                    borderRadius: "10px",
                    backgroundColor: " rgb(11, 26, 51) ",
                    boxShadow: "5px 5px 10px 5px rgba(101,175,10, 0.5)",
                  }}
                >
                  <div className="img d-flex justify-content-center align-content-center p-3">
                    <img
                      src={`${data.imageSrc}`}
                      className="card-img-top"
                      alt="..."
                      style={{
                        width: "250px",
                        height: "200px",
                        border: "2px solid yellowgreen",
                        borderRadius: "10px",
                      }}
                    />
                  </div>

                  <div className="card-body text-center">
                    <h5 className="card-title">{data.title}</h5>
                    <p className="card-text">{data.description}</p>
                    <a href={data.demo} className="btn btn-primary mx-3">
                      Demo
                    </a>
                    <a href={data.source} className="btn btn-warning">
                      Code
                    </a>
                  </div>
                </div>
              </div>
            </>
          ))}
        </div>
      </div>
    </>
  );
};

export default Projects;
